Here's an example of how you can use the `reqwest` crate to make a POST request to the elevenlabs.io api and play the audio using the `rodio` crate:

```rust
use reqwest;
use rodio::{Decoder, Sink, Source};
use std::io::Cursor;

#[tokio::main]
async fn main() {
    let text = ClipboardProvider::new().sync().unwrap();
    let client = reqwest::Client::new();
    let response = client
        .post("https://api.elevenlabs.io/v1/text-to-speech/21m00Tcm4TlvDq8ikWAM")
        .header("xi-api-key", "YOUR_API_KEY")
        .json(&json!({ "text": text }))
        .send()
        .await
        .unwrap();
    let audio_data = response.bytes().await.unwrap();
    let audio = Cursor::new(audio_data);
    let (_stream, stream_handle) = rodio::OutputStream::try_default().unwrap();
    let sink = Sink::try_new(&stream_handle).unwrap();
    let source = Decoder::new(audio).unwrap();
    sink.append(source.convert_samples());
    sink.sleep_until_end();
}
```

