export default Layout;
```

However, when I use the component with the centered variant, the width is not centered on the page. Instead, it is aligned to the left. I have tried to add `mx-auto` to the className but it does not seem to have any effect.

Can anyone help me understand why the centered variant is not being centered on the page and how I can fix this?

## Answer (1)

You need to add `max-w-7xl` to your className. This will limit the width of the div to 7xl (which is 80ch or 1280px) and then `mx-auto` will center it.

```
import React from 'react';

type Props = {
  variant?: 'full-width' | 'centered';
  children: React.ReactNode;
};

const Layout: React.FC<Props> = ({ variant = 'full-width', children }) => {
  return (
    <div
      className={`px-4 py-16 mx-auto max-w-7xl ${
        variant === 'full-width' ? 'w-full' : 'w-9/10 mx-auto'
      }`}
    >
      {children}
    </div>
  );
};

export default Layout;
```

